import React from "react";
import { createDrawerNavigator } from "@react-navigation/drawer";
import { createStackNavigator } from '@react-navigation/stack';
import HomeScreen from "../screens/HomeScreen";
import SettingScreen from "../screens/SettingScreen";
import Splash from "../screens/Splash";
import Profile from "../screens/Profile";

const Drawer = createDrawerNavigator()
const Stack = createStackNavigator(); // Importa el StackNavigator

export function DrawerNavigation(){
    return(
            <Drawer.Navigator>
                <Drawer.Screen name="Inicio" component={HomeScreen}/>
                <Drawer.Screen name="Mi Perfil" component={Profile}/>
                <Drawer.Screen name="Publicar" component={SettingScreen}/>
                <Drawer.Screen name="Notificaciones" component={SettingScreen}/>
                <Drawer.Screen name="Sobre Nosotros" component={SettingScreen}/>
                <Drawer.Screen name="Configuracion" component={SettingScreen} >
                </Drawer.Screen>
            </Drawer.Navigator>

    )
}
